$(()=>{$.ajax({url:"http://127.0.0.1:3000/api/getcategorytitle",dataType:"json",success:t=>{let{result:a}=t,e="";a.forEach(t=>{e+=`\n                    <li>\n                        <a class="category_title" style="background-image:url('http://www.zuyushop.com/wap/images/arrow1.gif');" data-id="${t.titleId}">\n                        ${t.title}\n                        </a>\n                        <ul class="category-content clearfix">\n                        </ul>\n                    </li> \n                `}),$(".category-title").html(e)}}),$(".category-title").on("click",".category_title",function(){let t=$(this).attr("data-id");$(this).parent().hasClass("cateHide")?$(this).parent().removeClass("cateHide"):$.ajax({url:"http://127.0.0.1:3000/api/getcategory",data:{titleid:t},dataType:"json",success:t=>{let{result:a}=t,e="";a.forEach(t=>{e+=`\n                        <li>\n                            <a href="productlist.html?categoryid=${t.categoryId}&category=${t.category}&pageid=1">\n                            ${t.category}\n                            </a>\n                        </li>\n                        `}),$(this).next().html(e),$(this).parent().addClass("cateHide")}})})});